import React from 'react';
import {Link} from 'react-router-dom';
import styles from './Navigation.module.scss';

const Navigation = () => (
    <nav>
    <ul className={styles.wrapper}>
        <li className={styles.link}><Link to="/articles">Articles</Link></li>
        <li className={styles.link}><Link to="/notes">Notes</Link></li>
        <li className={styles.link}><Link to="/">Twitters</Link></li>
    </ul>
    </nav>
);

export default Navigation;
